    private void LlenaDesc()
    {
      String vDescuentos;
      String vDet[];
      String vDet2[];
      vDescuentos=this.getDescu();
      int vPos;
       try
       {
       if (vDesc==null ) 
       {
         vDesc = new Number[31];        
         for (int i=0;i<vDesc.length;i++)
         {
            vDesc[i]=new Number(0); 
         }
       
       }
       
          if (vDescuentos!=null)
           {
             vDet=vDescuentos.split("\\|");
              
             for (int vI=0;vI<vDet.length;vI++)
             {
                 vDet2=vDet[vI].split("\\-");
                 vPos=Integer.parseInt(vDet2[0])-1;
                 //vPos=((vPos<=30):vPos?30);
                 if (vPos>30 || vPos<0 )vPos=30;                  
                this.vDesc[vPos]=utils.getNumberOracle(vDet2[1]);                  
            }
           }
        }catch(Exception exep){
            
        }
    }

